import React from 'react';
import './Bookings.css';

const bookings = [
  { id: 'BKG001', user: 'John Doe', package: 'Dubai Luxury Tour', date: '2025-10-12', travellers: 2, status: 'Confirmed', amount: '₹2,40,000' },
  { id: 'BKG002', user: 'Alice Smith', package: 'Kerala Backwaters', date: '2025-11-05', travellers: 4, status: 'Pending', amount: '₹1,00,000' },
];

export default function Bookings() {
  return (
    <div className="page bookings-page">
      <h2>Bookings</h2>
      <table className="table">
        <thead><tr><th>Booking ID</th><th>User</th><th>Package</th><th>Date</th><th>Travellers</th><th>Status</th><th>Amount</th></tr></thead>
        <tbody>
          {bookings.map(b => (
            <tr key={b.id}>
              <td>{b.id}</td><td>{b.user}</td><td>{b.package}</td><td>{b.date}</td><td>{b.travellers}</td><td>{b.status}</td><td>{b.amount}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
